        <meta content="Zapis z POSt" property="og:title">
        <meta content="website" property="og:type">
        <meta content="./" property="og:url">
        <meta content="" property="og:image">
        <meta content="Zapis z hodiny POSt" property="og:description">
        <link href="//cdn.muicss.com/mui-0.9.30/css/mui.min.css" rel="stylesheet" type="text/css">
        <script src="//cdn.muicss.com/mui-0.9.30/js/mui.min.js">
        </script>
    </head>
    <body>
        <div class="mui-container">
            <h1>
                Topologie s&iacute;t&iacute;
            </h1>
            <ul>
                <li>
                    nab&yacute;v&aacute; se zapojen&iacute;m různ&yacute;ch prvků do poč&iacute;tačov&yacute;ch s&iacute;t&iacute;
                </li>
                <li>
                    fyzick&aacute; &ndash; re&aacute;ln&aacute; konstrukce s&iacute;tě, um&iacute;stěn&iacute; jednotliv&yacute;ch zař&iacute;zen&iacute; a kabelů
                </li>
                <li>
                    logick&aacute;(virtu&aacute;ln&iacute;) - jak jsou data přen&aacute;&scaron;ena, zapojen&iacute; do centr&aacute;ln&iacute;ho prvku
                </li>
            </ul>
            <h2>
                S&eacute;riov&aacute; topologie (Serial)
            </h2>
            <ul>
                <li>
                    zastaral&aacute;, nepouž&iacute;v&aacute; se, nejstar&scaron;&iacute; topologie
                </li>
                <li>
                    přeru&scaron;en&iacute; komunikace nast&aacute;v&aacute; při poru&scaron;en&iacute; uzlu, nebo kabelu
                </li>
            </ul>
            <h2>
                Sběrnicov&aacute; topologie (Bus)
            </h2>
            <p>
                <img src="data:image/png;base64,">
            </p>
            <ul>
                <li>
                    spojen&iacute; je zprostředkov&aacute;no sběrnic&iacute; (jedin&eacute; přenosov&eacute; m&eacute;dium)
                </li>
                <li>
                    každ&aacute; sběrnice je zakončena termin&aacute;tory
                </li>
                <li>
                    ke sběrnici jsou připojeny v&scaron;echny uzly
                </li>
                <li>
                    n&iacute;zk&aacute; cena
                </li>
                <li>
                    může doch&aacute;zet ke koliz&iacute;m
                </li>
                <li>
                    přeru&scaron;en&iacute; sběrnice = přeru&scaron;en&iacute; komunikace
                </li>
                <li>
                    nověj&scaron;&iacute; topologie
                </li>
                <li>
                    nepouž&iacute;v&aacute; se
                </li>
            </ul>
            <h2>
                Kruhov&aacute; topologie (RING)
            </h2>
            <p>
                <img src="data:image/jpeg;base64,">
            </p>
            <ul>
                <li>
                    jednosměrn&eacute; zapojen&iacute;
                </li>
                <li>
                    vylep&scaron;en&aacute; s&eacute;riov&aacute; topologie
                </li>
                <li>
                    přenos dat je jednoduch&yacute;
                </li>
                <li>
                    data mus&iacute; j&iacute;t přes v&scaron;echny uzly
                </li>
                <li>
                    komunikace pomoc&iacute; protokolů, token ringu
                </li>
                <li>
                    naru&scaron;en&iacute; komunikace, = přid&aacute;n&iacute;/odebr&aacute;n&iacute; uzlu, přeru&scaron;en&iacute; kabelu
                </li>
            </ul>
            <h2>
                Dual ring
            </h2>
            <p>
                <img src="data:image/jpeg;base64,">
            </p>
            <ul>
                <li>
                    nověj&scaron;&iacute; kruhov&aacute; topologie
                </li>
                <li>
                    dva fyzick&eacute; okruhy
                </li>
                <li>
                    pokud prvn&iacute; selže může b&yacute;t nahrazen druh&yacute;m, jak v lok&aacute;ln&iacute;ch, tak i veřejn&yacute;ch s&iacute;t&iacute;ch, medium je optick&eacute; vl&aacute;kno
                </li>
                <li>
                    zapojen&iacute;/odpojen&iacute; bez v&yacute;padku
                </li>
                <li>
                    data mus&iacute; proj&iacute;t přes v&scaron;echny uzly
                </li>
            </ul>
            <div class="paticka" style="text-align: center;">
                <hr>
                <p style="text-align: center; font-size: 75%; border:0%; padding:0%">
                    Copyright &copy; 2018, by Hony
                </p>
            </div>
        </div>
    </body>
